import{_ as i}from"./plugin-vue_export-helper.21dcd24c.js";import{o as a,c as e,d as t}from"./app.a3d402e1.js";var l="/assets/project-purchasing-management.png",r="/assets/project-purchasing-management-1.png",s="/assets/project-purchasing-management-2.png",n="/assets/project-purchasing-management-3.png";const c={},h=t('<div class="custom-container tip"><p class="custom-container-title">\u524D\u8A00</p><p>\u8BB0\u5F55\u9879\u76EE\u91C7\u8D2D\u7BA1\u7406\u7AE0\u8282\u7684\u76F8\u5173\u77E5\u8BC6\u3001\u9891\u7E41\u8003\u70B9\u3002</p></div><h2 id="\u6838\u5FC3\u6982\u5FF5" tabindex="-1"><a class="header-anchor" href="#\u6838\u5FC3\u6982\u5FF5" aria-hidden="true">#</a> \u6838\u5FC3\u6982\u5FF5</h2><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>\u9879\u76EE\u7ECF\u7406\u4E0D\u5FC5\u6210\u4E3A\u91C7\u8D2D\u7BA1\u7406\u6CD5\u5F8B\u6CD5\u89C4\u9886\u57DF\u7684\u4E13\u5BB6, \u4F46\u662F\u5E94\u8BE5\u5BF9\u91C7\u8D2D\u8FC7\u7A0B\u6709\u8DB3\u591F\u7684\u4E86\u89E3\u3002\u91C7\u8D2D\u7BA1\u7406\u7684\u8FC7\u7A0B\u5305\u62EC\u89C4\u5212\u91C7\u8D2D\u7BA1\u7406\u3001\u5B9E\u65BD\u91C7\u8D2D\u3001\u63A7\u5236\u91C7\u8D2D\u548C\u7ED3\u675F\u91C7\u8D2D\u56DB\u4E2A\u73AF\u8282\u3002</p></div><p>\u901A\u5E38\u60C5\u51B5\u4E0B, \u9879\u76EE\u7ECF\u7406\u65E0\u6743\u7B7E\u7F72\u5BF9\u7EC4\u7EC7\u6709\u7EA6\u675F\u529B\u7684\u6CD5\u5F8B\u534F\u8BAE, \u8FD9\u9879\u5DE5\u4F5C\u4EC5\u7531\u5177\u5907\u76F8\u5173\u804C\u6743\u7684\u4EBA\u5458\u6267\u884C\u3002</p><p>\u56E0\u5E94\u7528\u9886\u57DF\u4E0D\u540C, \u534F\u8BAE\u53EF\u4EE5\u662F\u5408\u540C\u3001\u670D\u52A1\u6C34\u5E73\u534F\u8BAE\uFF08SLA\uFF09\u3001\u8C05\u89E3\u5907\u5FD8\u5F55\u3001\u534F\u8BAE\u5907\u5FD8\u5F55\uFF08MOA\uFF09\u6216\u8BA2\u8D2D\u5355\u3002</p><h2 id="\u601D\u7EF4\u5BFC\u56FE" tabindex="-1"><a class="header-anchor" href="#\u601D\u7EF4\u5BFC\u56FE" aria-hidden="true">#</a> \u601D\u7EF4\u5BFC\u56FE</h2><p><img src="'+l+'" alt="\u9879\u76EE\u91C7\u8D2D\u7BA1\u7406"></p><h2 id="\u89C4\u5212\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u89C4\u5212\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u89C4\u5212\u8FC7\u7A0B\u7EC4</h2><h3 id="\u89C4\u5212\u91C7\u8D2D\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u89C4\u5212\u91C7\u8D2D\u7BA1\u7406" aria-hidden="true">#</a> \u89C4\u5212\u91C7\u8D2D\u7BA1\u7406</h3><p>\u89C4\u5212\u91C7\u8D2D\u7BA1\u7406\u662F\u8BB0\u5F55\u9879\u76EE\u91C7\u8D2D\u51B3\u7B56\u3001\u660E\u786E\u91C7\u8D2D\u65B9\u6CD5, \u53CA\u8BC6\u522B\u6F5C\u5728\u5356\u65B9\u7684\u8FC7\u7A0B\u3002</p><p>\u4F5C\u7528\uFF1A\u786E\u5B9A\u662F\u5426\u4ECE\u9879\u76EE\u5916\u90E8\u83B7\u53D6\u8D27\u7269\u548C\u670D\u52A1\u3002\u5982\u679C\u662F, \u5219\u8FD8\u8981\u786E\u5B9A\u5C06\u5728\u4EC0\u4E48\u65F6\u95F4\u3001\u4EE5\u4EC0\u4E48\u65B9\u5F0F\u83B7\u53D6\u4EC0\u4E48\u8D27\u7269\u548C\u670D\u52A1\u3002</p><h4 id="\u603B\u4EF7\u5408\u540C" tabindex="-1"><a class="header-anchor" href="#\u603B\u4EF7\u5408\u540C" aria-hidden="true">#</a> \u603B\u4EF7\u5408\u540C</h4><ul><li>\u56FA\u5B9A\u603B\uFF08FFP\uFF09 =&gt; \u4EF7\u683C\u56FA\u5B9A\u4E0D\u53D8\uFF08\u9664\u975E\u5DE5\u4F5C\u8303\u56F4\u53D8\u66F4\uFF09;\u9002\u7528\u4E8E\uFF1A\u5DF2\u660E\u786E\u5B9A\u4E49\u9700\u6C42, \u4E14\u4E0D\u4F1A\u51FA\u73B0\u91CD\u5927\u8303\u56F4\u53D8\u66F4\u7684\u60C5\u51B5\u4E0B\u4F7F\u7528;\u6B64\u7C7B\u5408\u540C\u4E3A\u65E2\u5B9A\u4EA7\u54C1\u3001\u670D\u52A1\u6216\u6210\u679C\u7684\u91C7\u8D2D\u8BBE\u5B9A\u4E00\u4E2A\u603B\u4EF7</li><li>\u603B\u4EF7+\u6FC0\u52B1\uFF08FPIF\uFF09 =&gt; \u6700\u9AD8\u9650\u4EF7\u3001\u6709\u76EE\u6807\u7EE9\u6548\u3001\u6709\u5206\u644A\u6BD4\u4F8B <ul><li>\u603B\u4EF7 = \u5B9E\u9645\u6210\u672C + \u76EE\u6807\u5229\u6DA6 +\uFF08\u76EE\u6807\u6210\u672C - \u5B9E\u9645\u6210\u672C\uFF09* \u5356\u65B9\u5E94\u627F\u62C5\u6BD4\u4F8B</li><li>\u548C\u6700\u9AD8\u9650\u4EF7\u6BD4\u8F83, \u8BA1\u7B97\u6700\u7EC8\u603B\u4EF7</li><li>\u5229\u6DA6 = \u6700\u7EC8\u603B\u4EF7 - \u5B9E\u9645\u6210\u672C</li></ul></li><li>\u603B\u4EF7\u52A0\u7ECF\u6D4E\u4EF7\u683C\u8C03\u6574\uFF08FP-EPA\uFF09 =&gt; \u8DE8\u8D8A\u8F83\u957F\u65F6\u671F\uFF08\u6570\u5E74\uFF09\u3001\u8003\u8651\u901A\u8D27\u81A8\u80C0\u3001\u6210\u672C\u589E\u964D</li></ul><div class="custom-container tip"><p class="custom-container-title">\u56FA\u5B9A\u603B\u4EF7\u5408\u540C\uFF08FFP\uFF09</p><p>FFP \u662F\u6700\u5E38\u7528\u7684\u5408\u540C\u7C7B\u578B\u3002\u5927\u591A\u6570\u4E70\u65B9\u90FD\u559C\u6B22\u8FD9\u79CD\u5408\u540C</p><ul><li>\u56E0\u4E3A\u91C7\u8D2D\u7684\u4EF7\u683C\u5728\u4E00\u5F00\u59CB\u5C31\u786E\u5B9A, \u5E76\u4E14\u4E0D\u5141\u8BB8\u6539\u53D8\uFF08\u9664\u975E\u5DE5\u4F5C\u8303\u56F4\u53D1\u751F\u53D8\u66F4\uFF09\u3002</li><li>\u5356\u65B9\u6709\u4E49\u52A1\u5B8C\u6210\u5DE5\u4F5C, \u5E76\u4E14\u627F\u62C5\u56E0\u4E0D\u826F\u7EE9\u6548\u5BFC\u81F4\u7684\u4EFB\u4F55\u6210\u672C\u589E\u52A0\u3002</li><li>\u5728 FFP \u5408\u540C\u4E0B, \u4E70\u65B9\u5E94\u8BE5\u51C6\u786E\u5B9A\u4E49\u62DF\u91C7\u8D2D\u7684\u4EA7\u54C1\u548C\u670D\u52A1, \u5BF9\u91C7\u8D2D\u89C4\u8303\u7684\u4EFB\u4F55\u53D8\u66F4\u90FD\u4F1A\u589E\u52A0\u4E70\u65B9\u7684\u6210\u672C</li></ul></div><div class="custom-container tip"><p class="custom-container-title">\u603B\u4EF7\u52A0\u6FC0\u52B1\u8D39\u7528\u5408\u540C\uFF08FPIF\uFF09</p><p>\u5141\u8BB8\u4E00\u5B9A\u7684\u7EE9\u6548\u504F\u79BB, \u5E76\u5BF9\u5B9E\u73B0\u65E2\u5B9A\u76EE\u6807\u7ED9\u4E0E\u76F8\u5173\u7684\u8D22\u52A1\u5956\u52B1\uFF08\u901A\u5E38\u53D6\u51B3\u4E8E\u5356\u65B9\u7684\u6210\u672C\u3001\u8FDB\u5EA6\u6216\u6280\u672F\u7EE9\u6548\uFF09\u3002</p><ul><li>\u5728 FPIF \u5408\u540C\u4E2D, \u8981\u8BBE\u7F6E\u4EF7\u683C\u4E0A\u9650, \u5356\u65B9\u5FC5\u987B\u5B8C\u6210\u5DE5\u4F5C\u5E76\u4E14\u8981\u627F\u62C5\u9AD8\u4E8E\u4E0A\u9650\u7684\u5168\u90E8\u6210\u672C\u3002</li></ul></div><div class="custom-container tip"><p class="custom-container-title">\u603B\u4EF7\u52A0\u7ECF\u6D4E\u4EF7\u683C\u8C03\u6574\u5408\u540C\uFF08FPEPA\uFF09</p><p>\u9002\u7528\u4E8E\uFF1A\u5356\u65B9\u5C65\u7EA6\u671F\u5C06\u8DE8\u8D8A\u51E0\u5E74\uFF1B\u5C06\u4EE5\u4E0D\u540C\u8D27\u5E01\u652F\u4ED8\u4EF7\u6B3E\u3002</p><ul><li>\u5141\u8BB8\u6839\u636E\u6761\u4EF6\u53D8\u5316\uFF08\u5982\u901A\u8D27\u81A8\u80C0\u3001\u67D0\u4E9B\u7279\u6B8A\u5546\u54C1\u7684\u6210\u672C\u589E\u964D), \u4EE5\u4E8B\u5148\u786E\u5B9A\u7684\u65B9\u5F0F\u5BF9\u5408\u540C\u4EF7\u683C\u8FDB\u884C\u6700\u7EC8\u8C03\u6574\u3002</li></ul></div><h4 id="\u5DE5\u6599\u5408\u540C" tabindex="-1"><a class="header-anchor" href="#\u5DE5\u6599\u5408\u540C" aria-hidden="true">#</a> \u5DE5\u6599\u5408\u540C</h4><ul><li>T&amp;M =&gt; \u5DE5\u671F\u77ED\u3001\u91D1\u989D\u5C0F\u3001\u4E0D\u590D\u6742\u3001\u7D27\u6025\u60C5\u51B5\u3001\u65E0 SOW</li><li>\u517C\u5177\u6210\u672C\u8865\u507F\u5408\u540C\u548C\u603B\u4EF7\u5408\u540C\u7684\u67D0\u4E9B\u7279\u70B9\u7684\u6DF7\u5408\u578B\u5408\u540C</li><li>\u9002\u7528\u4E8E, \u5728\u65E0\u6CD5\u5FEB\u901F\u7F16\u5236\u51FA\u51C6\u786E\u7684\u5DE5\u4F5C\u8BF4\u660E\u4E66\u7684\u60C5\u51B5\u4E0B\u6269\u5145\u4EBA\u5458\u3001\u8058\u7528\u4E13\u5BB6\u6216\u5BFB\u6C42\u5916\u90E8\u652F\u6301\u3002</li></ul><h4 id="\u6210\u672C\u8865\u507F\u5408\u540C" tabindex="-1"><a class="header-anchor" href="#\u6210\u672C\u8865\u507F\u5408\u540C" aria-hidden="true">#</a> \u6210\u672C\u8865\u507F\u5408\u540C</h4><p>\u5411\u5356\u65B9\u652F\u4ED8\u4E3A\u5B8C\u6210\u5DE5\u4F5C\u800C\u53D1\u751F\u7684\u5168\u90E8\u5408\u6CD5\u5B9E\u9645\u6210\u672C\uFF08\u53EF\u62A5\u9500\u6210\u672C\uFF09, \u5916\u52A0\u4E00\u7B14\u8D39\u7528\u4F5C\u4E3A\u5356\u65B9\u7684\u5229\u6DA6;\u9002\u7528\u4E8E\uFF1A\u5DE5\u4F5C\u8303\u56F4\u9884\u8BA1\u4F1A\u5728\u5408\u540C\u6267\u884C\u671F\u95F4\u53D1\u751F\u91CD\u5927\u53D8\u66F4</p><ul><li>\u6210\u672C+\u6FC0\u52B1\uFF08CPIF\uFF09 =&gt; \u53EF\u80FD\u6709\u5229\u6DA6\u4E0A\u4E0B\u9650\u3001\u6709\u76EE\u6807\u7EE9\u6548\u3001\u6709\u5206\u644A\u6BD4\u4F8B <ul><li>\u5229\u6DA6 = \u76EE\u6807\u5229\u6DA6 + \uFF08\u76EE\u6807\u6210\u672C - \u5B9E\u9645\u6210\u672C\uFF09* \u5356\u65B9\u5E94\u627F\u62C5\u6BD4\u4F8B</li><li>\u548C\u5229\u6DA6\u4E0A\u4E0B\u9650\u6BD4, \u6280\u672F\u6700\u7EC8\u5229\u6DA6</li><li>\u603B\u4EF7 = \u6700\u7EC8\u5229\u6DA6 + \u5B9E\u9645\u6210\u672C</li></ul></li><li>\u6210\u672C+\u5956\u52B1\uFF08CPAF\uFF09 =&gt; \u7EE9\u6548\u6807\u51C6\u4E3B\u89C2\u7B3C\u7EDF\u3001\u4E0D\u5141\u8BB8\u7533\u8BC9</li><li>\u6210\u672C+\u56FA\u5B9A\u8D39\u7528\uFF08CPFF\uFF09 =&gt; \u521D\u59CB\u6210\u672C\u4F30\u7B97\u7684\u767E\u5206\u6BD4, \u4E0D\u8003\u8651\u7EE9\u6548 <ul><li>\u5B9E\u9645\u603B\u4EF7 = \u5B9E\u9645\u6210\u672C+\u521D\u59CB\u6210\u672C\u767E\u5206\u6BD4</li></ul></li></ul><div class="custom-container tip"><p class="custom-container-title">\u6210\u672C\u52A0\u56FA\u5B9A\u8D39\u7528\u5408\u540C\uFF08CPFF\uFF09</p><p>\u4E3A\u5356\u65B9\u62A5\u9500\u5C65\u884C\u5408\u540C\u5DE5\u4F5C\u6240\u53D1\u751F\u7684\u4E00\u5207\u53EF\u5217\u652F\u6210\u672C, \u5E76\u5411\u5356\u65B9\u652F\u4ED8\u4E00\u7B14\u56FA\u5B9A\u8D39\u7528, \u8BE5\u8D39\u7528\u4EE5\u9879\u76EE\u521D\u59CB\u6210\u672C\u4F30\u7B97\u7684\u67D0\u4E00\u767E\u5206\u6BD4\u8BA1\u7B97\u3002</p></div><div class="custom-container tip"><p class="custom-container-title">\u6210\u672C\u52A0\u6FC0\u52B1\u8D39\u7528\uFF08CPIF\uFF09</p><p>\u4E3A\u5356\u65B9\u62A5\u9500\u5C65\u884C\u5408\u540C\u5DE5\u4F5C\u6240\u53D1\u751F\u7684\u4E00\u5207\u53EF\u5217\u652F\u6210\u672C, \u5E76\u5728\u5356\u65B9\u8FBE\u5230\u5408\u540C\u89C4\u5B9A\u7684\u7EE9\u6548\u76EE\u6807\u65F6, \u5411\u5356\u65B9\u652F\u4ED8\u9884\u5148\u786E\u5B9A\u7684\u6FC0\u52B1\u8D39\u7528\u3002</p><ul><li>\u5728 CPIF \u5408\u540C\u4E2D, \u5982\u679C\u6700\u7EC8\u6210\u672C\u4F4E\u4E8E\u6216\u9AD8\u4E8E\u539F\u59CB\u4F30\u7B97\u6210\u672C, \u5219\u4E70\u65B9\u548C\u5356\u65B9\u9700\u8981\u6839\u636E\u4E8B\u5148\u5546\u5B9A\u7684\u6210\u672C\u5206\u644A\u6BD4\u4F8B\u6765\u5206\u4EAB\u8282\u7EA6\u90E8\u5206\u6216\u5206\u62C5\u8D85\u51FA\u90E8\u5206\u3002</li><li>\u4E0E\u603B\u4EF7\u52A0\u6FC0\u52B1\u8D39\u7528\u76F8\u6BD4, \u4E0D\u5B58\u5728\u603B\u4EF7\u4E0A\u7684\u6700\u9AD8\u9650\u4EF7\u3002</li><li>\u4F46\u6709\u65F6\u4F1A\u51FA\u73B0\u5229\u6DA6\u7684\u6700\u9AD8\u9650\u4EF7\u548C\u6700\u4F4E\u9650\u4EF7\u3002</li></ul></div><div class="custom-container tip"><p class="custom-container-title">\u6210\u672C\u52A0\u5956\u52B1\u8D39\u7528\uFF08CPAF\uFF09</p><p>\u4E3A\u5356\u65B9\u62A5\u9500\u4E00\u5207\u5408\u6CD5\u6210\u672C, \u4F46\u53EA\u6709\u5728\u5356\u65B9\u6EE1\u8DB3\u5408\u540C\u89C4\u5B9A\u7684\u3001\u67D0\u4E9B\u7B3C\u7EDF\u4E3B\u89C2\u7684\u7EE9\u6548\u6807\u51C6\u7684\u60C5\u51B5\u4E0B, \u624D\u5411\u5356\u65B9\u652F\u4ED8\u5927\u90E8\u5206\u8D39\u7528\u3002</p><ul><li>\u5B8C\u5168\u7531\u4E70\u65B9\u6839\u636E\u81EA\u5DF1\u5BF9\u5356\u65B9\u7EE9\u6548\u7684\u4E3B\u89C2\u5224\u65AD\u6765\u51B3\u5B9A\u5956\u52B1\u8D39\u7528, \u5E76\u4E14\u901A\u5E38\u4E0D\u5141\u8BB8\u7533\u8BC9.</li></ul></div><h4 id="itto" tabindex="-1"><a class="header-anchor" href="#itto" aria-hidden="true">#</a> ITTO</h4><p>\u9884\u5148\u6279\u51C6\u7684\u5356\u65B9\u6E05\u5355----\u7ECF\u8FC7\u9002\u5F53\u5BA1\u67E5\u7684\u5356\u65B9\u6E05\u5355\u53EF\u4EE5\u7B80\u5316\u62DB\u6807\u6240\u9700\u7684\u6B65\u9AA4, \u5E76\u7F29\u77ED\u5356\u65B9\u7504\u9009\u8FC7\u7A0B\u7684\u65F6\u95F4</p><p>\u91C7\u8D2D\u5DE5\u4F5C\u8BF4\u660E\u4E66\uFF1A\u5145\u5206\u8BE6\u7EC6\u5730\u63CF\u8FF0\u62DF\u91C7\u8D2D\u7684\u4EA7\u54C1\u3001\u670D\u52A1\u6216\u6210\u679C, \u4EE5\u4FBF\u6F5C\u5728\u5356\u65B9\u786E\u5B9A\u662F\u5426\u6709\u80FD\u529B\u63D0\u4F9B\u6B64\u7C7B\u4EA7\u54C1\u3001\u670D\u52A1\u6216\u6210\u679C\u3002\u91C7\u8D2D\u5DE5\u4F5C\u8BF4\u660E\u4E66\u5E94\u529B\u6C42\u6E05\u6670\u3001\u5B8C\u6574\u548C\u7B80\u7EC3\u3002\u5B83\u9700\u8981\u8BF4\u660E\u6240\u9700\u7684\u9644\u52A0\u670D\u52A1, \u4F8B\u5982, \u62A5\u544A\u7EE9\u6548, \u6216\u5BF9\u91C7\u8D2D\u54C1\u7684\u540E\u7EED\u8FD0\u8425\u652F\u6301\u3002\u5728\u91C7\u8D2D\u8FC7\u7A0B\u4E2D, \u5E94\u6839\u636E\u9700\u8981\u5BF9\u5DE5\u4F5C\u8BF4\u660E\u4E66\u8FDB\u884C\u4FEE\u8BA2, \u76F4\u5230\u5B83\u6210\u4E3A\u6240\u7B7E\u534F\u8BAE\u7684\u4E00\u90E8\u5206\u3002</p><p><img src="'+r+'" alt="\u9879\u76EE\u91C7\u8D2D\u7BA1\u7406-\u89C4\u5212\u91C7\u8D2D\u7BA1\u7406"></p><h2 id="\u5B9E\u65BD\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u5B9E\u65BD\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u5B9E\u65BD\u8FC7\u7A0B\u7EC4</h2><h3 id="\u5B9E\u65BD\u91C7\u8D2D" tabindex="-1"><a class="header-anchor" href="#\u5B9E\u65BD\u91C7\u8D2D" aria-hidden="true">#</a> \u5B9E\u65BD\u91C7\u8D2D</h3><p>\u5B9E\u65BD\u91C7\u8D2D\u662F\u83B7\u53D6\u5356\u65B9\u5E94\u7B54\u3001\u9009\u62E9\u5356\u65B9\u5E76\u6388\u4E88\u5408\u540C\u7684\u8FC7\u7A0B\u3002\u4E3B\u8981\u4F5C\u7528\u662F, \u9009\u5B9A\u5408\u683C\u5356\u65B9\u5E76\u7B7E\u7F72\u5173\u4E8E\u8D27\u7269\u6216\u670D\u52A1\u4EA4\u4ED8\u7684\u6CD5\u5F8B\u534F\u8BAE\u3002</p><h4 id="itto-1" tabindex="-1"><a class="header-anchor" href="#itto-1" aria-hidden="true">#</a> ITTO</h4><p><img src="'+s+'" alt="\u9879\u76EE\u91C7\u8D2D\u7BA1\u7406-\u5B9E\u65BD\u91C7\u8D2D\u7BA1\u7406"></p><h2 id="\u76D1\u63A7\u8FC7\u7A0B\u7EC4" tabindex="-1"><a class="header-anchor" href="#\u76D1\u63A7\u8FC7\u7A0B\u7EC4" aria-hidden="true">#</a> \u76D1\u63A7\u8FC7\u7A0B\u7EC4</h2><h3 id="\u63A7\u5236\u91C7\u8D2D" tabindex="-1"><a class="header-anchor" href="#\u63A7\u5236\u91C7\u8D2D" aria-hidden="true">#</a> \u63A7\u5236\u91C7\u8D2D</h3><p>\u63A7\u5236\u91C7\u8D2D\u662F\u7BA1\u7406\u91C7\u8D2D\u5173\u7CFB, \u76D1\u7763\u5408\u540C\u7EE9\u6548, \u5B9E\u65BD\u5FC5\u8981\u7684\u53D8\u66F4\u548C\u7EA0\u504F, \u4EE5\u53CA\u5173\u95ED\u5408\u540C\u7684\u8FC7\u7A0B\u3002</p><h4 id="\u5408\u540C\u63D0\u524D\u7EC8\u6B62" tabindex="-1"><a class="header-anchor" href="#\u5408\u540C\u63D0\u524D\u7EC8\u6B62" aria-hidden="true">#</a> \u5408\u540C\u63D0\u524D\u7EC8\u6B62</h4><p>\u5408\u540C\u63D0\u524D\u7EC8\u6B62\u662F\u7ED3\u675F\u91C7\u8D2D\u7684\u4E00\u4E2A\u7279\u4F8B, \u6709\u4EE5\u4E0B\u4E09\u79CD\u60C5\u51B5\u4F1A\u63D0\u524D\u7EC8\u6B62\uFF1A</p><ol><li>\u5408\u540C\u53EF\u7531\u53CC\u65B9\u534F\u5546\u4E00\u81F4\u800C\u63D0\u524D\u7EC8\u6B62,</li><li>\u6216\u56E0\u4E00\u65B9\u8FDD\u7EA6\u800C\u63D0\u524D\u7EC8\u6B62,</li><li>\u6216\u8005\u4E3A\u4E70\u65B9\u7684\u4FBF\u5229\u800C\u63D0\u524D\u7EC8\u6B62\uFF08\u5982\u679C\u5408\u540C\u4E2D\u6709\u8FD9\u79CD\u89C4\u5B9A\uFF09\u3002</li></ol><p>\u5982\u679C\u5408\u540C\u63D0\u524D\u7EC8\u6B62\uFF1A</p><ol><li>\u5BF9\u8BE5\u5408\u540C\u6216\u8BE5\u90E8\u5206\u4E2D\u5DF2\u7ECF\u5B8C\u6210\u548C\u9A8C\u6536\u7684\u5DE5\u4F5C\u652F\u4ED8\u62A5\u916C</li><li>\u5BF9\u5356\u65B9\u4E3A\u8BE5\u5408\u540C\u6216\u8BE5\u90E8\u5206\u6240\u505A\u7684\u51C6\u5907\u5DE5\u4F5C\u7ED9\u4E88\u8865\u507F</li></ol><h4 id="itto-2" tabindex="-1"><a class="header-anchor" href="#itto-2" aria-hidden="true">#</a> ITTO</h4><p><img src="'+n+'" alt="\u9879\u76EE\u91C7\u8D2D\u7BA1\u7406-\u5B9E\u65BD\u91C7\u8D2D\u7BA1\u7406"></p>',43),d=[h];function p(o,u){return a(),e("div",null,d)}var F=i(c,[["render",p],["__file","project-purchasing-management.html.vue"]]);export{F as default};
